const Results = ({ result }) => {
  if (!result) return null;

  const { verdict, score, modules } = result;

  return (
    <div>
      <h2>Verdict: {verdict.toUpperCase()} (Score: {score})</h2>
      <pre>{JSON.stringify(modules, null, 2)}</pre>
    </div>
  );
};

export default Results;
